/*Table structure for table `admin` */

DROP TABLE IF EXISTS `admin`;

CREATE TABLE `admin` (
  `Id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `Login` varchar(20) CHARACTER SET latin1 NOT NULL DEFAULT '',
  `Senha` varchar(10) CHARACTER SET latin1 NOT NULL DEFAULT '',
  `Nome` varchar(35) CHARACTER SET latin1 NOT NULL DEFAULT '',
  `Master` enum('s','n') CHARACTER SET latin1 NOT NULL DEFAULT 'n',
  `Fiscal` char(5) CHARACTER SET latin1 NOT NULL DEFAULT 'nao',
  `Acesso` varchar(20) CHARACTER SET latin1 DEFAULT NULL,
  `Acesso2` varchar(20) CHARACTER SET latin1 DEFAULT NULL,
  `Acesso3` varchar(20) CHARACTER SET latin1 DEFAULT NULL,
  `Acesso4` varchar(20) CHARACTER SET latin1 DEFAULT NULL,
  `email` varchar(300) CHARACTER SET latin1 DEFAULT NULL,
  `name_port` varchar(50) CHARACTER SET latin1 DEFAULT NULL,
  `portaria` mediumblob,
  `type_port` varchar(50) CHARACTER SET latin1 DEFAULT NULL,
  `size_port` varchar(50) CHARACTER SET latin1 DEFAULT NULL,
  `n_port` varchar(50) CHARACTER SET latin1 DEFAULT NULL,
  PRIMARY KEY (`Id`),
  UNIQUE KEY `Login_admin` (`Login`),
  KEY `Master` (`Master`)
) ENGINE=InnoDB AUTO_INCREMENT=447 DEFAULT CHARSET=utf8;

