/*Table structure for table `afastamento` */

DROP TABLE IF EXISTS `afastamento`;

CREATE TABLE `afastamento` (
  `id` double NOT NULL AUTO_INCREMENT,
  `descricao2` varchar(500) CHARACTER SET latin1 DEFAULT NULL,
  `Data` varchar(15) CHARACTER SET latin1 DEFAULT NULL,
  `Hora` varchar(15) CHARACTER SET latin1 DEFAULT NULL,
  `n_contrato` varchar(50) DEFAULT NULL,
  `usuario` varchar(150) CHARACTER SET latin1 NOT NULL,
  `data_entrada_ev` date DEFAULT '0000-00-00',
  `data_saida_ev` date DEFAULT '0000-00-00',
  `id_fun` int(20) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `afastamento` */

/*Table structure for table `anos` */

DROP TABLE IF EXISTS `anos`;

CREATE TABLE `anos` (
  `codano` int(10) NOT NULL AUTO_INCREMENT,
  `ano` int(10) DEFAULT NULL,
  PRIMARY KEY (`codano`)
) ENGINE=InnoDB AUTO_INCREMENT=27 DEFAULT CHARSET=utf8mb4;

