/*Table structure for table `arquivos` */

DROP TABLE IF EXISTS `arquivos`;

CREATE TABLE `arquivos` (
  `codarq` bigint(100) NOT NULL AUTO_INCREMENT,
  `contrato` bigint(20) NOT NULL DEFAULT '0',
  `ano` int(10) NOT NULL DEFAULT '0',
  `mes` bigint(20) NOT NULL DEFAULT '0',
  `tipo_arq` bigint(100) NOT NULL DEFAULT '0',
  `codempresa` bigint(100) NOT NULL DEFAULT '0',
  `status` char(50) DEFAULT NULL,
  `anexo` longblob,
  `size` varchar(50) DEFAULT NULL,
  `type` varchar(50) DEFAULT NULL,
  `name` varchar(50) DEFAULT NULL,
  `obs` varchar(500) DEFAULT NULL,
  `ativo` enum('Y','N') DEFAULT 'Y',
  PRIMARY KEY (`codarq`),
  UNIQUE KEY `ano_mes` (`ano`,`mes`,`contrato`,`codempresa`),
  KEY `FK_arquivos_contratos` (`contrato`),
  KEY `FK_arquivos_meses` (`mes`),
  KEY `FK_arquivos_tipodoc` (`tipo_arq`),
  KEY `FK_arquivos_tab_empresa` (`codempresa`),
  CONSTRAINT `FK_arquivos_anos` FOREIGN KEY (`ano`) REFERENCES `anos` (`codano`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `FK_arquivos_contratos` FOREIGN KEY (`contrato`) REFERENCES `contratos` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `FK_arquivos_meses` FOREIGN KEY (`mes`) REFERENCES `meses` (`codmes`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `FK_arquivos_tab_empresa` FOREIGN KEY (`codempresa`) REFERENCES `tab_empresa` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `FK_arquivos_tipodoc` FOREIGN KEY (`tipo_arq`) REFERENCES `tipodoc` (`iddoc`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=latin7;

/*Data for the table `arquivos` */

