/*Table structure for table `contratos` */

DROP TABLE IF EXISTS `contratos`;

CREATE TABLE `contratos` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `tipo_contrato` varchar(150) DEFAULT NULL,
  `n_processo` varchar(150) CHARACTER SET latin1 DEFAULT NULL,
  `n_contrato` varchar(150) CHARACTER SET latin1 DEFAULT NULL,
  `descricao` varchar(500) CHARACTER SET latin1 DEFAULT NULL,
  `empresa` varchar(150) CHARACTER SET latin1 DEFAULT NULL,
  `valor_contrato` varchar(150) CHARACTER SET latin1 DEFAULT NULL,
  `valor_mensal` varchar(150) CHARACTER SET latin1 DEFAULT NULL,
  `vigencia_1` varchar(10) DEFAULT NULL,
  `vigencia` date DEFAULT NULL,
  `fiscal` varchar(150) CHARACTER SET latin1 NOT NULL,
  `fiscal_sub_1` varchar(150) DEFAULT NULL,
  `fiscal_sub_2` varchar(150) DEFAULT NULL,
  `fiscal_sub_3` varchar(150) DEFAULT NULL,
  `fiscal_sub_4` varchar(150) CHARACTER SET latin1 DEFAULT NULL,
  `Ativo` enum('Sim','Nao') CHARACTER SET latin1 NOT NULL DEFAULT 'Sim',
  `fim_contrato` date DEFAULT NULL,
  `email` varchar(200) DEFAULT NULL,
  `id_fiscal` int(30) DEFAULT NULL,
  `renovacao_01` date DEFAULT '0000-00-00',
  `renovacao_02` date DEFAULT '0000-00-00',
  `renovacao_03` date DEFAULT '0000-00-00',
  `renovacao_04` date DEFAULT '0000-00-00',
  `name_arq` varchar(50) NOT NULL,
  `anexo` longblob NOT NULL,
  `type_arq` varchar(50) NOT NULL,
  `size_arq` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8;

