/*Table structure for table `documentos` */

DROP TABLE IF EXISTS `documentos`;

/*!50001 DROP VIEW IF EXISTS `documentos` */;
/*!50001 DROP TABLE IF EXISTS `documentos` */;

/*!50001 CREATE TABLE  `documentos`(
 `obs` varchar(500) ,
 `ativo` enum('Y','N') ,
 `codarq` bigint(100) ,
 `ano` int(10) ,
 `mes` char(50) ,
 `status` char(50) ,
 `name` varchar(50) ,
 `nome` varchar(50) ,
 `empresa` varchar(150) ,
 `n_contrato` varchar(150) ,
 `codano` int(10) 
)*/;

/*View structure for view documentos */

/*!50001 DROP TABLE IF EXISTS `documentos` */;
/*!50001 DROP VIEW IF EXISTS `documentos` */;

/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `documentos` AS (select `arquivos`.`obs` AS `obs`,`arquivos`.`ativo` AS `ativo`,`arquivos`.`codarq` AS `codarq`,`anos`.`ano` AS `ano`,`meses`.`mes` AS `mes`,`arquivos`.`status` AS `status`,`arquivos`.`name` AS `name`,`tipodoc`.`nome` AS `nome`,`tab_empresa`.`empresa` AS `empresa`,`contratos`.`n_contrato` AS `n_contrato`,`anos`.`codano` AS `codano` from (((((`arquivos` join `tab_empresa`) join `tipodoc`) join `meses`) join `anos`) join `contratos`) where ((`tab_empresa`.`id` = `arquivos`.`codempresa`) and (`arquivos`.`tipo_arq` = `tipodoc`.`iddoc`) and (`arquivos`.`ano` = `anos`.`codano`) and (`arquivos`.`mes` = `meses`.`codmes`) and (`arquivos`.`contrato` = `contratos`.`id`)) order by `anos`.`ano`) */;

